let timerName = null,
    settingsKey = null,
    interval = setInterval(update, 200),
    settings = {
      endTime: null,
      pausedAt: null,
      remainingMs: 0,
      visible: true,
    };

function pad(n) {
  return (n + "").padStart(2, '0');
}

function update() {
  const now = Date.now();
  let remainingMs = 0;
  
  if (settings.endTime === null) {
    remainingMs = settings.remainingMs;
  } else if (settings.pausedAt !== null) {
    remainingMs = settings.endTime - settings.pausedAt;
  } else {
    remainingMs = settings.endTime - now;
  }

  remainingMs = Math.max(remainingMs, 0);

  const totalSeconds = Math.floor(remainingMs / 1000);
  const hours = Math.floor(totalSeconds / 3600);
  const minutes = Math.floor((totalSeconds % 3600) / 60);
  const seconds = totalSeconds % 60;

  const parts = [];
  if (hours > 0) {
    parts.push(pad(hours) + "h");
  }
  if (hours > 0 || minutes > 0) {
    parts.push(pad(minutes) + "m");
  }
  parts.push(pad(seconds) + "s");

  const element = document.getElementById("timer");
  element.textContent = parts.join(" ");
  element.style.visibility = (settings.visible ?? true) ? 'visible' : 'hidden';

  if (remainingMs === 0 && settings.endTime !== null) {
    stop();
  }
}

function save() {
  SE_API.store.set(settingsKey, settings);
}

function start() {
  const now = Date.now();
  if (settings.pausedAt !== null) {
    const pauseDuration = now - settings.pausedAt;
    settings.endTime += pauseDuration;
    settings.pausedAt = null;
  } else if (settings.remainingMs > 0) {
    settings.endTime = now + settings.remainingMs;
  } else {
    return;
  }
  save();
}

function stop() {
  settings.endTime = null;
  settings.pausedAt = null;
  settings.remainingMs = 0;
  save();
}

function reset() {
  if (settings.pausedAt) {
    settings.pausedAt = null;
    settings.endTime = Date.now() + settings.remainingMs;
  } else if (settings.endTime !== null) {
    const remainingTime = settings.endTime - Date.now();
    settings.endTime = Date.now() + remainingTime;
  }
  save();
}

function pause() {
  if (settings.pausedAt !== null || settings.endTime === null) return;
  settings.pausedAt = Date.now();
  settings.remainingMs = settings.endTime - settings.pausedAt;
  save();
}

function hide() {
  settings.visible = false;
  save();
}

function show() {
  settings.visible = true;
  save();
}

function add(seconds) {
  const ms = seconds * 1000;
  if (settings.endTime === null) {
    settings.remainingMs += ms;
  } else {
    settings.endTime += ms;
  }
  save();
}

window.addEventListener('onWidgetLoad', function(obj) {
  timerName = obj.detail.fieldData.timerName;
  settingsKey = `timerSettings--${ timerName }`;

  SE_API.store.get(settingsKey).then(existingSettings => {
    if (existingSettings !== null) {
      settings = existingSettings;
    }
    interval = setInterval(update, 200);
  });
});

window.addEventListener('onEventReceived', function(obj) {
  const listener = obj.detail.listener;
  const event = obj.detail.event;

  if (!event || !listener) return;

  if (listener === 'message' && (event.data.tags.mod === "1" || event.data.tags.badges.includes('broadcaster/1'))) {
    if (event.data.text.startsWith(`!timer start ${ timerName }`.trim())) {
      const duration = parseInt(event.data.text.split(' ')[3], 10);
      start(duration);
    } else if (event.data.text.startsWith(`!timer stop ${ timerName }`.trim())) {
      stop();
    } else if (event.data.text.startsWith(`!timer reset ${ timerName }`.trim())) {
      reset();
    } else if (event.data.text.startsWith(`!timer pause ${ timerName }`.trim())) {
      pause();
    } else if (event.data.text.startsWith(`!timer hide ${ timerName }`.trim())) {
      hide();
    } else if (event.data.text.startsWith(`!timer show ${ timerName }`.trim())) {
      show();
    }
  } else if (listener === 'kvstore:update' && event.data.key === settingsKey) {
    settings = event.data.value;
  } else if (listener === 'widget-button' || (listener === 'event:test' && event.listener === 'widget-button')) {
    const button = event.field || event.data.field;
    if (button === 'start') {
      start();
    } else if (button === 'stop') {
      stop();
    } else if (button === 'reset') {
      reset();
    } else if (button === 'pause') {
      pause();
    } else if (button === 'add10s') {
      add(10);
    } else if (button === 'add1m') {
      add(60);
    } else if (button === 'add5m') {
      add(300);
    } else if (button === 'hide') {
      hide();
    } else if (button === 'show') {
      show();
    }
  }
});

