#!/usr/bin/env bash

PATH="/usr/lib/ccache/bin:$HOME/.local/bin:$HOME/bin:/snap/bin:$PATH"
XDG_DATA_DIRS="$XDG_DATA_DIRS:/var/lib/flatpak/exports/share"
# If not running interactively, don't do anything
case $- in
    *i*) ;;
      *) return;;
esac

# don't put duplicate lines or lines starting with space in the history.
# See bash(1) for more options
HISTCONTROL=ignoreboth

# append to the history file, don't overwrite it
shopt -s histappend

# for setting history length see HISTSIZE and HISTFILESIZE in bash(1)
HISTSIZE=1000
HISTFILESIZE=2000

# check the window size after each command and, if necessary,
# update the values of LINES and COLUMNS.
shopt -s checkwinsize

# make less more friendly for non-text input files, see lesspipe(1)
[ -x /usr/bin/lesspipe ] && eval "$(SHELL=/bin/sh lesspipe)"


# set a fancy prompt (non-color, unless we know we "want" color)
case "$TERM" in
    xterm-color|*-256color) color_prompt=yes;;
esac

if ! shopt -oq posix; then
  if [ -f /usr/share/bash-completion/bash_completion ]; then
    . /usr/share/bash-completion/bash_completion
  elif [ -f /etc/bash_completion ]; then
    . /etc/bash_completion
  fi
fi
export VISUAL="nano"

SYS_ID="$(lsb_release -si)"

backup_vars() {
    OLDEDITOR=${EDITOR}
    OLDHOME=${HOME}
    OLDLANG=${LANG}
    OLDPATH=${PATH}
    OLDPS1=${PS1}
    OLDTERM=${TERM}
    echo -e "*Backup variables*
OLDEDITOR=${EDITOR}
OLDHOME=${HOME}
OLDLANG=${LANG}
OLDPATH=${PATH}
OLDPS1=${PS1}
OLDTERM=${TERM}"
}

restore_vars() {
    EDITOR=${OLDEDITOR}
    HOME=${OLDHOME}
    LANG=${OLDLANG}
    PATH=${OLDPATH}
    PS1=${OLDPS1}
    TERM=${OLDTERM}
    echo -e "*Restore variables*
EDITOR=${OLDEDITOR}
HOME=${OLDHOME}
LANG=${OLDLANG}
PATH=${OLDPATH}
PS1=${OLDPS1}
TERM=${OLDTERM}"
}

prepare_mxe(){
backup_vars
unset `env | \
    grep -vi '^EDITOR=\|^HOME=\|^LANG=\|MXE\|^PATH=' | \
    grep -vi 'PKG_CONFIG\|PROXY\|^PS1=\|^TERM=' | \
    cut -d '=' -f1 | tr '\n' ' '`
export PATH=$PATH:/home/vitaly/github/mxe/usr/bin
}
run_mxe_cmake(){
prepare_mxe
i686-w64-mingw32.shared-cmake $@
restore_vars
}
run_mxe_cmake_64(){
prepare_mxe
x86_64-w64-mingw32.shared-cmake $@
restore_vars
}

update_ubuntu_system() {
    sudo apt update && sudo apt dist-upgrade
}

update_ubuntu_all() {
    update_ubuntu_system
    sudo update-apt-xapian-index -vf && sudo snap refresh \
    && flatpak update
}

clean_ubuntu_system() {
    sudo apt autoremove && sudo apt autoclean
}

update_system() {
    trizen -Suy
}

clean_system() {
    sudo pacman -Qtdq | sudo pacman -Rns - || echo "Nothing to clean"
}

install_custom_pkg() {
    sudo pacman -U $@
}

git_commit() {
    if [ ! -z "$1" ]; then
        git commit -am"$@"
        echo "Do you want to push your changes [y/n]"
        read answ
        if [ "${answ}" == "y" ] || [ "${answ}" == "Y" ]; then
            git push
        fi
    else
        echo "Command usage:
gitcommit \"Description\""
    fi
}

build_arch_pkg() {
    if [ ! -z "$1" ]; then
        cdir=$(pwd)
        cd "$@"
        makepkg -ifCc
        cd ${cdir}
    fi
}

